import React from "react";
import Test_1 from "../img/Test_1.jpeg";
import { TestDiv } from "../styledComponents";
import Banner from "./Banner";
// import { getLists } from "../test_list";

const Test = () => {
  // const lists = getLists();

  return (
    <div>
      <TestDiv>
        <Banner></Banner>
        <div className="contentWrapper">
          <img src={Test_1} alt="Test_1"></img>
          <div className="buttonWrapper">
            <button className="option1"></button>
            <button className="option2"></button>
          </div>
        </div>
      </TestDiv>
    </div>
  );
};

export default Test;
